export type FormField = {
  label: string;
  type: "text" | "email" | "password";
};

export const LoginFields: Record<string, FormField> = {
  Email: {
    label: "Email",
    type: "email",
  },
  Password: {
    label: "Password",
    type: "password",
  },
};

export const RegisterFields: FormField[] = [
  {
    label: "Full Name",
    type: "text",
  },
  {
    label: "Email",
    type: "email",
  },
  {
    label: "Password",
    type: "password",
  },
];
